	(6, 'Pakej Khas Eksklusif', 'home', '544374-banner-3.jpg', '<div class="vertical-align">								 \r\n <div class="item-block style-4">					 	 	 \r\n   <div class="vertical-align">					 	 	 					 	 	 					 	 	 						 	 	 	 \r\n    <h3 class="hover-it color-blue-2">Pakej Khas Eksklusif</h3>	\r\n    <h4>dari <b>RM 6890</b></h4>\r\n    <br><br><br><br>	\r\n<div class="rate">											<span class="fa fa-star color-yellow"></span> 											<span class="fa fa-star color-yellow"></span> 											<span class="fa fa-star color-yellow"></span> 											<span class="fa fa-star color-yellow"></span> 											<span class="fa fa-star color-yellow"></span> 									 	</div>			 	 	 	 \r\n     <div class="main-date">Keselesaan dalam Kesempurnaan Beribadah</div>					 	 	 \r\n     <p>Hotel 5 bintang berdekatan dengan Masjidil Haram dan Masjid Nabawi</p>									</div>\r\n</div>\r\n</div>	', 'https://harmony.oomrah.com/package?cat=22', 'Lihat Senarai Pakej Eksklusif', 2, 'enable', '2018-03-08 18:17:07', '2018-07-29 20:17:04', 2),
