INSERT INTO `tb_pages` (`pageID`, `title`, `alias`, `note`, `created`, `updated`, `filename`, `status`, `access`, `allow_guest`, `template`, `metakey`, `metadesc`, `default`, `pagetype`, `labels`, `views`, `userid`, `image`, `header`, `owner_id`) VALUES
	(1, 'Home', 'home', '<h3><b>Special Umrah packages drafted to cater all the requirements of Muslims in Malaysia</b></h3><p>Oomrah Travel is providing the best Umrah 5 star packages in Malaysia for most affordable price. We are a popular and reliable name in the industry of tourism. Our travel agency is trusted by thousands of Malaysia citizens. Book the cheapest Umrah package by consulting with our tour operator agents. We consider detailed aspect of all deals before making the offer to Malaysia citizens. Without a doubt, Umrah is one of the best ways of gaining Allah (SWT’s) blessings. Oomrah Travel agency is proud to facilitate Malaysia Muslims in performing pilgrimage by availing affordable priced 5 star deals. It is our primary duty to ensure the convenience and satisfaction of pilgrims on the holy tour of Umrah to Mecca and Medina.</p><p>Oomrah Travel operator creates and designs the best packages including 5 star hotel accommodation, air conditioned local transport, direct return flight tickets and appropriate guidance. Everything is packed within the cheap priced package of Umrah for Malaysia citizens. Choose the flight dates of choice for going to Umrah. People belonging to London, Bradford, Manchester and Birmingham are well aware of our travel agency. We would like to assist you in the best manner by providing amazing deals for Umrah tour. You can expect everything to be 5 star within our cheap priced deals at low price. Oomrah Travel operator can provide detailed guidance services on booking the best 5 star deal for Umrah in Mecca and Medina.</p>', '2017-10-04 11:46:50', '2018-02-06 18:39:56', 'page', 'enable', '{"1":"1","2":"1","3":"1","4":"1","5":"1","6":"1","7":"0"}', '1', 'frontend', NULL, NULL, '1', NULL, NULL, 0, NULL, '170226-orange-zac-durant-302752.jpg', 'home', 1),
	(2, 'About Us', 'about', '<p>Umrah courses are conducted on Saturdays and Sundays from 9 a.m. - 1 p.m. Our courses are led by instructors who have vast experience in hajj and umrah. Umrah courses are also conducted at our branches. Clients can contact the nearest branch for further information and schedules of the courses. As of September 2017, there are 35 branches spread over Peninsula Malaysia. Clients can book and make payments at our branches. </p><p>Our branches also accept personal documents like passports, marriage certificates and other documents required while undertaking a journey umrah. Apart from registering for Umrah at our Headquarters or branches, clients can now book and reqister for umrah through our online.<br></p>', '2017-10-04 12:00:40', '2018-02-13 15:15:57', 'page', 'enable', '{"1":"0","2":"1","3":"0","4":"0","5":"0","6":"0","7":"0"}', NULL, 'frontend', NULL, NULL, '0', NULL, NULL, 177, NULL, NULL, '', 1),
	(3, 'Contact Us', 'contact', '<p><span style="color: rgb(52, 73, 94); font-weight: bold;">!!FormHelpers|render|4!!</span><br></p>', '2017-10-10 03:33:54', '2018-03-08 10:23:19', 'page', 'enable', '{"1":"0","2":"1","3":"1","4":"1","5":"1","6":"1","7":"0"}', '1', 'frontend', NULL, NULL, '0', NULL, NULL, 34, NULL, '15295-Nabawi-1.jpg', '', 2),
