	(6, 'harmony', 'harmony', '<style>\r\n.col-md-3.col-sm-6.col-xs-12 {\r\n    padding: 0px;\r\n}\r\n</style>\r\n\r\n  <div class="row col-no-pad">\r\n    <div class="col-md-3 col-sm-6 col-xs-12">\r\n<div class="photo-block hover-aqua">\r\n<div class="tour-layer delay-1"></div>\r\n<img src="https://i.imgur.com/RoTXgsV.png" alt="">\r\n<div class="vertical-align">\r\n<div class="photo-title">\r\n<h4 class="delay-1"><b><span class="color-aqua">Available</span></b></h4>\r\n<a class="hover-it" href="#"><h3 class="color-white">UMRAH</h3></a>\r\n<h5 class="delay-1">See Package</h5>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n    <div class="col-md-3 col-sm-6 col-xs-12">\r\n<div class="photo-block hover-aqua">\r\n<div class="tour-layer delay-1"></div>\r\n<img src="https://i.imgur.com/vHcLUXF.png" alt="">\r\n<div class="vertical-align">\r\n<div class="photo-title">\r\n<h4 class="delay-1"><b><span class="color-aqua">Available</span></b></h4>\r\n<a class="hover-it" href="#"><h3 class="color-white">OUTBOUND</h3></a>\r\n<h5 class="delay-1">See Package</h5>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n    <div class="col-md-3 col-sm-6 col-xs-12">\r\n<div class="photo-block hover-aqua">\r\n<div class="tour-layer delay-1"></div>\r\n<img src="https://i.imgur.com/DaK49eO.png" alt="">\r\n<div class="vertical-align">\r\n<div class="photo-title">\r\n<h4 class="delay-1"><b><span class="color-aqua">Available</span></b></h4>\r\n<a class="hover-it" href="#"><h3 class="color-white">AQIQAH QURBAN</h3></a>\r\n<h5 class="delay-1">See Package</h5>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n    <div class="col-md-3 col-sm-6 col-xs-12">\r\n<div class="photo-block hover-aqua">\r\n<div class="tour-layer delay-1"></div>\r\n<img src="https://i.imgur.com/9sKJgbQ.png" alt="">\r\n<div class="vertical-align">\r\n<div class="photo-title">\r\n<h4 class="delay-1"><b><span class="color-aqua">Available</span></b></h4>\r\n<a class="hover-it" href="#"><h3 class="color-white">RESORT</h3></a>\r\n<h5 class="