INSERT INTO `termsandconditions` (`tandcID`, `title`, `tandc`, `created_at`, `updated_at`, `status`, `type`, `owner_id`) VALUES
	(3, 'tnc', '<p>qwerqwer</p>', '2018-05-15 10:44:39', NULL, 1, 1, 8),
	(4, 'Standard Terms & Conditions', '<h3 style="box-sizing: inherit; margin-top: 0px; margin-bottom: 1.5rem; font-family: Arimo, "Helvetica Neue", Arial, sans-serif; color: rgb(82, 89, 94); font-size: 1.75rem; text-align: center;"><span style="box-sizing: inherit; font-weight: bolder;">TERMS & CONDITIONS</span></h3><h4 style="box-sizing: inherit; margin-top: 0px; margin-bottom: 1.5rem; font-family: Arimo, "Helvetica Neue", Arial, sans-serif; color: rgb(82, 89, 94); font-size: 1.5rem; text-align: center;">Tour members of customers are deemed to have read, understood and accepted the following Terms and Conditions. The Company and its marketing/sales agents are referred to as the “organizers”.</h4><div style="box-sizing: inherit; color: rgb(82, 89, 94); font-family: Arimo, "Helvetica Neue", Arial, sans-serif; font-size: 16px;"></div><ol style="box-sizing: inherit; margin-bottom: 1rem; color: rgb(82, 89, 94); font-family: Arimo, "Helvetica Neue", Arial, sans-serif; font-size: 16px;"><li style="box-sizing: inherit;">The tour fare includes: –<br style="box-sizing: inherit;">(a) A non-refundable and non-transferable return economy class group air ticket(excluding airport tax and fuel surcharge).<br style="box-sizing: inherit;">(b) Accomodation is based on adult twin sharing. Child fare is based on the child as a third person, sharing either a twin or a double-room with two accompanying adults. No extra bed is provided. A surcharge applies if a child occupies half a twin.<br style="box-sizing: inherit;">(c) All meals, sightseeing and other programs are as specified in the itinerary<br style="box-sizing: inherit;">(d) Baggage allowance is as per the airlines’ regulations.</li><li style="box-sizing: inherit;">No refund or price reduction will be made for the non-utilization of any items or service included in the tour fare.</li><li style="box-sizing: inherit;">A minimum deposit of RM1000 or 40% of the tour fare per person, whichever is higher, must be paid upon reservation and the balance must be paid at least 21 days prior to departure date. Currency fluctuations: All tour fares and airport taxes are subject to currency fluctuations. All tour fares are guaranteed only if the reservations are accompanied by the full payment.</li><li style="box-sizing: inherit;"><span style="box-sizing: inherit; font-weight: bolder;">Cancellation:</span> There is no refund for special fare tickets. Ticketing conditions permitting, normal fare tickets are refundable, less penalty and admin fees. Tour fare paid is non-refundable.</li><li style="box-sizing: inherit;">The organizers reserve the right to cancel or withdraw at anytime, all tour departures due to insufficient group size, or for any reason whatsoever. The decision on the organizers for such cancellations is final.</li><li style="box-sizing: inherit;"><span style="box-sizing: inherit; font-weight: bolder;">Travel insurance:</span> All customers are recommended to purchase comprehensive travel insurance. The organizers act as an agent and are not held liable for any claims. All claims are referred to the insurance company.</li><li style="box-sizing: inherit;"><span style="box-sizing: inherit; font-weight: bolder;">Passport validity :</span> All tour members must personally ensure that their passports are valid for at least 6 months from the date of return.</li><li style="box-sizing: inherit;"><span style="box-sizing: inherit; font-weight: bolder;">Visa application:</span> All customers are encouraged to process their own visa. Assistance is offered by the organizers but visa approval is not guaranteed. In so doing, the organizers cannot be held liable for any loss of passport(s) for any reason whatsoever, including negligence on the part of our employees and agents.</li><li style="box-sizing: inherit;">The organizers act only as agents for the airlines, transportation companies and hotel contractors. Ticket vouchers and documents which are issued are subjected to those terms and contracts under which these services are provided.</li><li style="box-sizing: inherit;">The organizers shall not be held liable to any person as a result of the followings: –<br style="box-sizing: inherit;">(a) Inaccuracy, wrong description or changes to any tour and its itinerary.<br style="box-sizing: inherit;">(b) Additional expenses due to delays or changes in any transport services, sickness, weather, death, strikes, wars, quarantine, or other causes.<br style="box-sizing: inherit;">(c) Extension of stay and flight arrangements that cannot be confirmed.<br style="box-sizing: inherit;">(d) Any damage to or loss of baggage and personal items or accidents are the responsibility of tour members or customers. Hence, tour members or customers are encouraged to purchase travel insurance.<br style="box-sizing: inherit;">(e) Deportation or refusal of entry to tour members by immigration authorities due to possession of unlawful items, improper travel documents or for behavior and activities considered as subversive by the foreign government concerned.</li><li style="box-sizing: inherit;">The organizers reserve the right to modify, with or without prior notice, the itinerary, travel arrangement and hotel accommodation, or withdraw the service of an accompanying tour manager due to unforeseen circumstances, over which the organizers have no control.</li><li style="box-sizing: inherit;">The organizers will only provide the services of an accompanying tour manager for a group of at least 15 adults.</li><li style="box-sizing: inherit;">The tour will be operated on a seat-in-coach basis.</li><li style="box-sizing: inherit;">Problematic and uncooperative tour members whose act and conduct are deemed to be unreasonable and detrimental to the enjoyment, interest, well-being and safety of the other tour memembers or affecting the smooth running of tour in general will be dealt by the tour manager. The tour manager may require the problematic tour member(s) to leave the tour and his/her decision in this respect is final. The organizers shall not make a refund for any uncompleted part of the tour.</li><li style="box-sizing: inherit;">Please take note that the tour packages ARE NOT provided with the professional staff to provide for the needs and /or requirements of disabled/handicapped individuals (including and not limited to individuals with sight, speech, hearing, mobility disabilities) and those with critical conditions. The organizers strongly urge all the intended tour members to equip themselves with all special care and/or needs that they may require.  The organizers shall not be responsible for these in any manner whatsoever.</li><li style="box-sizing: inherit;">The information in the itinerary is correct and current at the time of printing and the organizers cannot guarantee that the items or amenities mentioned will remain unchanged, especially when the organizers have no direct control over it. In the event of a difference between the Chinese and English itineraries, the Chinese version will be deemed as the correct version.</li><li style="box-sizing: inherit;">Not withstanding the place or country in which a cause of action arises, it is expressly agreed here that all causes of action shall at all times be commenced within the jurisdiction territory of Malaysia, where the booking was made.</li><li style="box-sizing: inherit;">Tour fares and flight payment are based on cash term, and payment by credit cards are subject to a surcharge.</li><li style="box-sizing: inherit;">Customer’s name is based on the receipt or registration form. Hence, it is the customer’s own responsibility to ensure that there is no mistake in the name.</li><li style="box-sizing: inherit;"><span style="box-sizing: inherit; font-weight: bolder;">Splitting:</span> Tour members have to travel as a group on the pre-determined flights, otherwise a higher revised fare will apply.</li><li style="box-sizing: inherit;">All bookings made online does not include/come with additional items, such as bags and other merchandise.</li><li style="box-sizing: inherit;">All bookings made online does not include transfer to and from Penang International Airport. Customers are to meet directly at the airport for departure.</li><li style="box-sizing: inherit;">Prices indicated on this website are for online bookings only and may vary from walk-in prices.</li><li style="box-sizing: inherit;">The Company reserves the right to make amendments to online prices without prior notice, even after deposit has been paid.</li></ol>', '2018-05-23 15:41:28', '2018-11-19 10:55:42', 0, 1, 1),
	(5, 'Standard Terms & Conditions', '<p>Standard Terms &amp; Conditions.</p>', '2018-07-09 14:29:29', NULL, 1, 1, 14),
	(6, 'Terma dan Syarat', '<p>&nbsp;1. Deposit sebanyak 50%<br></p>', '2018-07-11 12:05:19', '2018-07-17 15:19:40', 1, 1, 2),
	(8, 'Peringatan', '<p class="MsoHeader" style="margin-left:108.0pt;text-indent:-108.0pt;tab-stops:\r\n36.0pt"><span lang="EN-US" style="font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif">1.Harga&nbsp; tertakluk&nbsp;\r\nkepada&nbsp; perubahan&nbsp;&nbsp; harga&nbsp;\r\ntiket&nbsp;&nbsp; kapalterbang, penginapan\r\ndan pertukaran wang.<o:p></o:p></span></p>\r\n\r\n<p class="MsoHeader" style="margin-left:108.0pt;tab-stops:36.0pt"><span lang="EN-US" style="font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif">&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class="MsoHeader" style="margin-left:108.0pt;tab-stops:36.0pt"><span lang="EN-US" style="font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif">2.Harga\r\npakej termasuk tiket&nbsp; penerbangan&nbsp; pergi&nbsp;\r\ndan&nbsp; balik&nbsp; kelas&nbsp;&nbsp;\r\nekonomi(Kuala Lumpur, Jeddah),pengangkutan&nbsp; menggunakan kenderaan berhawa&nbsp;&nbsp; dingin, penginapan&nbsp; hotel&nbsp;\r\ndi Mekah , Madinah ,&nbsp;&nbsp; penyediaan\r\nmakanan&nbsp; secara&nbsp; buffet&nbsp;\r\ntiga&nbsp; kali&nbsp; sehari&nbsp;\r\ndan&nbsp; 24 jam&nbsp;&nbsp; minuman panas dan sejuk di Madinah &amp;\r\nMekah,&nbsp; ziarah dan lawatan&nbsp; di Madinah, Mekah&nbsp; seperti di&nbsp;\r\ndalam aturcara, 1 beg bimbit dan 1 beg&nbsp;\r\nselendang, 5 liter air Zam-Zam dan satu&nbsp;\r\nkursus pendek&nbsp; bimbingan ibadah\r\numrah. <o:p></o:p></span></p>\r\n\r\n<p class="CcList" style="margin-left:3.0pt;text-indent:0cm"><span lang="EN-US" style="font-family:&quot;Times New Roman&quot;,serif"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class="CcList" style="margin-left:108.0pt;text-indent:0cm"><span lang="EN-US">3</span><span lang="EN-US" style="font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif">.Harga\r\npakej&nbsp; tidak&nbsp;&nbsp; termasuk&nbsp;&nbsp;\r\nsebarang&nbsp;&nbsp; perbelanjaan&nbsp;&nbsp;&nbsp; peribadi&nbsp;\r\n(telefon /&nbsp; faks&nbsp; / telegram&nbsp;\r\ndll), bayaran timbangan yang melebihi had yang dibenarkan. <o:p></o:p></span></p>\r\n\r\n<p class="CcList" style="margin-left:108.0pt;text-indent:0cm"><span lang="EN-US" style="font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<span lang="EN-US" style="font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;letter-spacing:-.25pt;mso-ansi-language:\r\nEN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA">4. Timbangan bagasi\r\npergi 20 kilogram setiap seorang dan untuk balik 30 kilogram termasuk timbangan\r\nair zam-zam &nbsp;5liter.</span>', '2018-08-09 14:29:17', NULL, 1, 1, 17),
