INSERT INTO `testimonials` (`testimonialID`, `namesurname`, `email`, `country`, `city`, `tour_name`, `tour_date`, `image`, `testimonial`, `status`, `created_at`, `updated_at`, `owner_id`) VALUES
	(5, 'Rashid Husain', NULL, NULL, 'Johor', '16', NULL, '288641-man1.jpeg', 'Terima kasih Oomrah Travels, pakej yang disediakan sangat memuaskan. Alhamdulillah semuanya selesa.', 1, '2018-06-28 12:12:30', '2018-06-28 20:12:30', 1),
	(6, 'Husna Ismail', NULL, NULL, 'Kelantan', '17', NULL, '539890-sister1.jpeg', 'Perjalanan yang sungguh selesa. Semua urusan umrah disediakan dengan teratur dan bersistematik. Terima kasih Oomrah Travels', 1, '2018-06-28 12:13:26', '2018-06-28 20:13:26', 1),
	(7, 'Haji Iskandar Darman', NULL, NULL, 'Selangor', '18', NULL, '904815-family1.jpeg', 'Kami sekeluarga sangat bersyukur dengan perkhidmatan cemerlang Oomrah Travels', 1, '2018-06-28 12:14:57', '2018-06-28 20:15:51', 1),
	(8, 'Puan Hidayati Nusi', NULL, NULL, 'Selangor', '24', NULL, '749533-testimonial-4.jpg', 'Terima kasih Harmony Travel & Tours. Perkhidmatan terbaik dari sebelum pergi ke Saudi Arabia hingga tamat sampai kembali ke Malaysia.', 1, '2018-07-29 15:55:11', '2018-08-15 02:19:44', 2),
	(9, 'En Wahid Ali', NULL, NULL, 'Melaka', '25', NULL, '746291-testimonial-3.jpg', 'Semua perjalanan umrah kami sekeluarga diuruskan dengan sangat baik dan berhemah dari semua krew Hatmony Travel & Tours.', 1, '2018-07-29 15:56:26', '2018-08-15 02:20:06', 2),
	(10, 'En Ali Abid', NULL, NULL, 'Sabah', '26', NULL, '145800-testimonial-2.jpg', 'Syukur semua ibadat umrah saya dan isteri selamat dijalankan dengan baik hasil khidmat dari Harmony Travel & Tour. Saya sangat selesa dengan perkhidmatan yang terbaik ini.', 1, '2018-07-29 15:58:48', '2018-08-15 02:20:24', 2),
	(11, 'Pn Soleha', NULL, NULL, 'Perak', '27', NULL, '611881-testimonial-1.jpg', 'Alhamdulilah, pakej umrah saya dan suami diuruskan oleh agensi yang sangat profesional dan cemerlang. Insha-Allah kami akan syorkan perkhidmatan dari Agensi ini kepada kaum keluarga dan sahabat kami.', 1, '2018-07-29 16:00:45', '2018-08-15 02:20:47', 2),
	(12, 'Ahmad Barakat', NULL, NULL, 'Pahang', '33', '2018-08-19', NULL, 'Terbaik dari ladang!', 1, '2018-08-19 23:52:53', '2018-08-20 07:52:53', 17);
