	(41, 'Umrah Al Quddus (Hotel 3 star)', 28, '<p><b>Umrah Al Quddus (min 30 pax)</b></p><p>September - November 2018</p><p>Hotel 3 star</p><p><b>Makkah</b><br>1. Anjum Hotel<br>2. Al Maqam Hotel<br>3. Millennium Hotel<br>4. Saraya Ajyad Hotel</p><p><b>Madinah</b><br>1. Mubarak Madinah Hotel<br>2. Gloria Hotel<br>3. Harmony Hotel</p><p><b>HARGA TERMASUK</b><br>- Tiket penerbangan pergi balik kelas Ekonomi<br>- Pengurusan Visa Umrah<br>- Penginapan di Makkah dan Madinah<br>- Makan 3x sehari<br>- Pengangkutan bas berhawa dingin di sepanjang perjalanan<br>- Mutawwif yang berpengalaman<br>- Ziarah di Makkah &amp; Madinah seperti dalam aturcara</p><p><b>PERCUMA</b><br>- Bag trolly + Bag kecil<br>- Telekung &amp; Kain Ihram<br>- Buku Panduan Umrah<br>- Air Zam Zam</p><p>Tarikh, hotel, penerbangan dan harga tertakluk kepada perubahan dan permintaan jemaah. Kelulusan Visa Umrah adalah <b>tertakluk</b> kepada pihak kedutaan Arab Saudi.</p>', 12, 10, 3, 1, NULL, 'SV', 'DIRECT FLIGHT', '30', 'KUL - JED / JED - KUL', 0, 184, NULL, 1, 1, '1,2,3', 10, '17,18,19,20,22', '2018-08-27 17:18:40', '2018-09-03 13:22:20', 14, '710127-shutterstock_155748275_500px.jpg', NULL, 0, 0, 6590, 6190, 5790, 0, 15),
