	(44, 'UMRAH MUSIM SEJUK', 28, '<ul><li>Tiket Penerbangan Ekonomi pergi dan balik dengan pesawat <b>SAUDI ARABIAN AIRLINES</b></li><li>Pengurusan Visa Umrah.</li><li>Penginapan di Madinah &amp; Makkah.</li><li>Makan 3x sehari : Sarapan Pagi, Makan Tengahari &amp; Makan Malam.</li><li>Pengangkutan berhawa dingin sepanjang perjalanan.</li><li>Mutawwif yang bertauliah.</li><li>Ziarah di Madinah &amp; Makkah seperti dalam aturcara.</li><li>\'Optional\': Ziarah ke Taif</li></ul><p><br></p><p><b>PERCUMA</b></p><p>Kursus umrah percuma + Minum Pagi &amp; Makan Tengahari</p><p><b>CENDERAHATI</b></p><p>Mini bag Troli &amp; Bag Kecil, </p><p>Telekung @ Kain Ihram</p><p>Buku Panduan UMRAH</p><p>Air Zam-Zam 5 Liter</p>', 12, 10, 3, 1, NULL, 'SV', 'NONE', '30', 'KUL-JED / JED -KUL', 0, 184, NULL, 1, 1, '2,3', 10, '17,18,19,20,22', '2018-09-03 12:42:30', '2018-09-03 13:02:53', 3, '931474-umrahismail.jpg', NULL, 0, 0, 8300, 7600, 7300, 0, 15),
	(45, 'Umrah Oktober', 28, '<p>*Tarikh, Hotel, Penerbangan dan Harga tertaluk kepada perubahan semasa dan permintaan jemaah. KELULUSAN VISA UMRAH ADALAH TERTALUK KEPADA PIHAK KEDUTAAN ARAB SAUDI</p><p><br></p><p><b>HARGA PAKEJ TERMASUK:</b></p><ul><li>Tiket penerbangan ekonomi pergi dan balik dengan pesawat <b>SAUDI ARABIAN AIRLINES</b></li><li>Pengurusan Visa Umrah</li><li>Penginapan di Madinah &amp; di Mekah</li><li>Makan 3# sehari: sarapan pagi, makan tengahari &amp; makan malam</li><li>pengakutan berhawa dingin sepanjang perjalanan.</li><li>Mutawif yang bertauliah</li><li>Ziarah di Madinah &amp; Makkah seperti dalam aturcara</li><li>\'Optional\' : Ziarah ke Taif.</li></ul><p><b>PERCUMA :</b></p><p>Kursus Umrah+Minum pagi &amp; Makan Tengah Hari</p><p><b>CENDERAHATI:</b></p><p>Mini Beg,Troli,&amp; Bag kecil, Telekung @ Kain Ihram Buku Panduan Umrah, Zamzam 5liter.</p>', 12, 10, 3, 1, NULL, 'SV', 'None', '30', 'KUL-JED / JED-KUL', 0, 184, NULL, 1, 1, '2,3', 10, '17,18,19,20,22', '2018-09-03 12:49:30', '2018-09-03 12:55:18', 2, '273147-52e183f5d022a1fe540ec63a24256799.jpg', NULL, 0, 0, 6590, 6190, 5790, 0, 15),
